import { useEffect, useState } from 'react';
import axios from 'axios';

export default function AttendanceDashboard(){
  const [records, setRecords] = useState([]);
  const [q, setQ] = useState('');
  const [date, setDate] = useState('');

  const fetchData = async () => {
    try {
      const params = {};
      if (q) params.q = q;
      if (date) params.date = date;
      const res = await axios.get('http://localhost:5000/api/attendance', { params });
      setRecords(res.data);
    } catch (err) {
      console.error(err);
      alert('Error fetching records.');
    }
  };

  useEffect(()=> {
    fetchData();
    const handler = () => fetchData();
    window.addEventListener('attendance:added', handler);
    return ()=> window.removeEventListener('attendance:added', handler);
  }, []);

  const handleDelete = async (id) => {
    if (!confirm('Delete this record?')) return;
    try {
      await axios.delete(`http://localhost:5000/api/attendance/${id}`);
      setRecords(r => r.filter(x => x.id !== id));
    } catch (err) {
      console.error(err);
      alert('Error deleting record.');
    }
  };

  return (
    <div>
      <div className="card mb-3">
        <div className="card-body">
          <h5 className="card-title">Filters & Search</h5>
          <div className="d-flex gap-2">
            <input className="form-control" placeholder="Search name or ID" value={q} onChange={e=>setQ(e.target.value)} />
            <input className="form-control" type="date" value={date} onChange={e=>setDate(e.target.value)} />
            <button className="btn btn-secondary" onClick={fetchData}>Apply</button>
            <button className="btn btn-outline-secondary" onClick={()=>{setQ(''); setDate(''); fetchData();}}>Clear</button>
          </div>
        </div>
      </div>

      <div className="card">
        <div className="card-body">
          <h5 className="card-title">Attendance Records ({records.length})</h5>
          <div className="table-responsive">
            <table className="table table-striped">
              <thead>
                <tr>
                  <th>ID</th><th>Name</th><th>Employee ID</th><th>Date</th><th>Status</th><th>Action</th>
                </tr>
              </thead>
              <tbody>
                {records.map(r => (
                  <tr key={r.id}>
                    <td>{r.id}</td>
                    <td>{r.employeeName}</td>
                    <td>{r.employeeID}</td>
                    <td>{r.date}</td>
                    <td>{r.status}</td>
                    <td><button className="btn btn-sm btn-danger" onClick={()=>handleDelete(r.id)}>Delete</button></td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      </div>
    </div>
  );
}
